def screen_blend_8(base: List[List[int]], active: List[List[int]]) -> List[List[int]]:
    return matrix_elemwise_sub(
        matrix_elemwise_add(base, active),
        matrix_elemwise_div(
            matrix_elemwise_mul(base, active),
            [[255]*len(base[0])] * len(base)
        )
    )
